import React from 'react';
import { Button, Typography, Container, Box} from '@material-ui/core';
import Table from "./table";
import { Banner} from 'material-ui-banner';
import TextField from '@material-ui/core/TextField'
import {makeStyles,use} from '@material-ui/core/styles'

function App() {
  const useStyles = makeStyles(theme => ({
    marginAutoContainer: {
      width: 500,
      height: 80,
      display: 'flex',
      backgroundColor: 'gold',
    },
    marginAutoItem: {
      margin: 'auto'
    },
    alignItemsAndJustifyContent: {
      width: 500,
      height: 80,
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: 'pink',
    },
  }))
  return (

  <Container maxWidth="sm">
    <Banner>
    </Banner>
    <TextField id="filled-basic" label="Data Value" variant="filled">

    </TextField>
      <Typography variant="h3" gutterBottom>
        MyApp
      </Typography>
      <Button color="primary" variant="contained">BUTTON</Button>
      <Box mt={3}>
        <Table />
      </Box>
   </Container>
  )

}

export default App;
